void init() {
	for (int i = 1; i <= 1000000; i++) {
		s[i] = s[i - 1] + i;
	}
	for (int i = 1; i <= 1000000; i++) {
		ss[i] = ss[i - 1] + s[i];
	}
	ss_odd[1] = 1;
	for (int i = 3; i <= 1000000; i += 2) {
		ss_odd[i] = ss_odd[i - 2] + s[i];
	}
	for (int i = 2; i <= 1000000; i += 2) {
		ss_even[i] = ss_even[i - 2] + s[i];
	}
}
int main(void) {
	init();
	int t; cin >> t;
	while (t--) {
		long long n; cin >> n;
		long long ans = ss[n];
		if (n % 2 == 0) {
			ans -= ss_odd[n - 1];
		}
		else {
			ans -= ss_even[n - 1];
		}
		cout <<ans << '\n';
	}
	return 0;
}

